function getPlayerGameLogAJAX(n,t,i){return this.PlayerID=n,this.Season=t,this.SeasonType=i,this.queryString="?PlayerID="+n+"&Season="+t+"&SeasonType="+i,this.apiURL="http://stats.nba.com/stats/playergamelog/"+this.queryString,this.ajaxResponse=$.ajax({url:this.apiURL,success:function(n){return console.log("Player Game log AJAX Request successfully transmitted."),n},error:function(n,t,i){return console.log("Status: "+t),alert("Error: "+i),null}}),ajaxResponse}function getObjectFromAJAX(n){return JSON.parse(n.responseText)}